import React, { Component } from "react";

class Flashcard extends Component{

    render(){
        return(
            <div>
                <p>Fiszka 1 </p>
                <p>{this.props.info.frontside}{this.props.info.backside}</p>
            </div>
        )
    }
}

export default Flashcard;
